script: |
  super -f text -I q10267.spq | sort > q10267.out

inputs:
  - name: q10267.spq
    data: |
      SELECT DISTINCT 65 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 BETWEEN + ( + + col0 ) - - - 11 AND - 8 * + ( - col2 );
  - name: tab0

outputs:
  - name: q10267.out
    data: |
      65
